<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="utf-8"/>
  <meta name="viewport" content="width=device-width,initial-scale=1"/>
  <title>Prototype Docs</title>
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify@4/lib/themes/vue.css"/>
  <meta name="robots" content="noindex,nofollow"/>
</head>
<body>
  <div id="app">Loading...</div>
  <script>
    window.$docsify = {
      name: 'Prototype Docs',
      homepage: 'docs/README.md',
      loadSidebar: 'docs/_sidebar.md',
      subMaxLevel: 2,
      routerMode: 'hash',
      alias: {
        '/docs/ユーザ一覧': '/docs/ユーザー一覧',
        '/docs/ユーザ一覧.md': '/docs/ユーザー一覧.md',
        '/ユーザ一覧': '/docs/ユーザー一覧',
        '/ユーザ一覧.md': '/docs/ユーザー一覧.md'
      }
    };
  </script>
  <script src="https://cdn.jsdelivr.net/npm/docsify@4/lib/docsify.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/docsify@4/lib/plugins/search.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/prismjs@1/components/prism-markdown.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/prismjs@1/components/prism-bash.min.js"></script>
</body>
</html>
